import React from 'react';
import { BottomSection, MainPhoto, MainPhotoContainer, MiddleSection, Title, TopSection, Wrapper } from './components';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'
import eltonMain from './img/eltonMain.png';
import elton1 from './img/elton1.jpg';

function App() {
  const slideImages = [
    {
      url: eltonMain,
      caption: 'Slide 1'
    },
    {
      url: elton1,
      caption: 'Slide 2'
    },
    {
      url: eltonMain,
      caption: 'Slide 3'
    },
  ];

  return (
    <Wrapper>
    <TopSection>
      <Title>
        Adopt Elton
      </Title>
      <Slide>
        {slideImages.map((slideImage, index)=> (
          <div key={index}>
            <MainPhotoContainer style={{ ...divStyle, 'backgroundImage': `url(${slideImage.url})` }} />  
          </div> 
        ))} 
        </Slide>
    </TopSection>
    <MiddleSection>

    </MiddleSection>
    <BottomSection>
    </BottomSection>
    </Wrapper>
  );
}

export default App;
